const projects = [
    {
        name: "personal-website",
        title: "Personal Website",
        description: "I believe it’s a better version of my resume :)",
        author: "Stacey Lee",
        date: "2020/9",
        downloadName: "personalWebsite",
        githubLink: "",
        vidLink: ""
    }
];

export default projects;

// downloadName is the component name of the imported file
// The component name of the images (in ProjectPreview.js) is the same as the title
